const BlogList = (props) => {
	return (
		<div>
			{props.props.map((blog) => {
				return (
					<div key={blog.id}>
						<h2>{blog.title}</h2>
						<p>{blog.author}</p>
						<p>{blog.text}</p>
					</div>
				);
			})}
		</div>
	);
};

export default BlogList;
